Macro photography has never been easier.

@auggiewrenphotography was kind enough to share some tips. We quote the entire submission below: "What is needed to do this kind of photography is a macro lens (I used a Photojojo macro lens), a mobile phone (I used an Xperia Ray), a light source and a slightly collaborative model. I found that the best results are obtained using a flashlight to lit the eye sideway rather than using the built-in led of the mobile. Best would be to have the phone mounted on a tripod and the model face resting somewhere. This because the field of view is really narrow and it is easy to blur the shot. Last, a neutral light will be the best choice to avoid wrestling with white balance.

This photo has been taken on Xperia Ray phone with a photojojo macro lens. I shot using the app Camerapro with the macro setting. The light source was a maglite flashlight. I transferred the photo to my ipad where i used Snapseed for the cropping, the image editing and to add a picture frame. Then, with Splashcolor app I have converted the image into b/w but the iris, to reduce distractions and guide the viewer's eyes where the interesting features are." #photogeekdom #ronixus #yummyjavaorg
